import React from 'react';
import Header from '../components/Header/Header'
import Footer from '../components/Footer/Footer'
import './Layout.css';

const Layout = ({ children }) => {
  return (
    <div classname= 'Layout'>
      <Header />
      {children}
      <Footer />
    </div>
  );
};

export default Layout;
